import './filter.css';

function filter() {
 

  return (
    <div className="div-filter">
        <p>Filters</p>
     <select name="products" id="products">
    <option value="volvo">Products</option>
    <option value="saab">Saab</option>
    <option value="opel">Opel</option>
    <option value="audi">Audi</option>
  </select>
    </div>
  );
}

export default filter;
